import './App.css';
import React from 'react';

function Nav() {
  return (
    <nav className="nav-links" >
      <h1>Logo</h1>
      <ul>
        <li>Login</li>
        <li>Register</li>
      </ul>
    </nav>
  );
}

export default Nav;
